import React from "react";
import "./style.css";

const Jumbotron = () => (
	<header className = "header">
		<h1>Harry Potter Clicky Game!</h1>
		<h2>Click on any image to earn a point, but don't click on any more than once!</h2>
	</header>
);


export default Jumbotron;
